local PostLoadFunc = function ( self, controller, menu )
	self.m_preventFromBeingActive = true
	self:subscribeToModel( Engine.CreateModel( Engine.GetModelForController( controller ), "six_pack_timer" ), function ( model )
		local modelValue = Engine.GetModelValue( model )
		if modelValue then
			self.BMSixPackCountdown.countdown:setText( LocalizeIntoString( "MENU_AVAILABLE_IN", modelValue ) )
		end
	end )
	self:subscribeToModel( Engine.CreateModel( Engine.GetModelForController( controller ), "daily_double_timer" ), function ( model )
		local modelValue = Engine.GetModelValue( model )
		if modelValue then
			self.BMDailyDoubleCountdown.countdown:setText( LocalizeIntoString( "MENU_AVAILABLE_IN", modelValue ) )
		end
	end )
end

